import React from 'react';
import Home from './Home';

function App() {
  return (
      <div className="App">
          <HashRouter>
              <Routes>
                  <Route path='/' element={<Navigate to='home'/>}/>
              </Routes>
          </HashRouter>
      </div>
  );
}

export default App;
